  complete_code: |
    from typing import List

    def match_parens(lst: List[str]) -> str:
        S1 = lst[0] + lst[1]
        S2 = lst[1] + lst[0]
        return 'Yes' if (check(S1) or check(S2)) else 'No'

    def check(s: str) -> bool:
        val = 0
        for i in s:
            if i == '(':
                val += 1
            elif i == ')':
                if val <= 0:
                    return False
                val -= 1
        return val == 0